sys_hub_input_scripts.script:
{"resource_path":{"scriptActive":true,"script":"/*
**Access Flow/Action data using the fd_data object. Script must return a value.
**Available options display upon pressing "." after fd_data
**example: var shortDesc = fd_data.trigger.current.short_description;
**return shortDesc;
*/
var ip_address = fd_data.action_inputs.ip_address;
var append = "/json";
ip_address = ip_address.replace("%EF");
ip_address = ip_address.replace("%BB");
ip_address = ip_address.replace("%BF");

var resourcePath = ip_address + append;
gs.info("IP Address: " + ip_address);
return decodeURI(resourcePath);"}}

sys_variable_value.value:
(function execute(inputs, outputs) {
// Only parse the response body if the status code is 200  
  if (inputs.status_code == '200'){
    // Parse the response_body input variable and save parsed object as responseBody
    var responseBody = JSON.parse(inputs.response_body);

    // Map the parsed responseBody values to output variables
    outputs.hostname = responseBody.hostname;
    outputs.city = responseBody.city;
    outputs.region = responseBody.region;
    outputs.country = responseBody.country;

    // split the returned location into separate latitude and longitude values
    var locArray = responseBody.loc.split(",");
    outputs.latitude = locArray[0];
    outputs.longitude = locArray[1];
  }
})(inputs, outputs);

